INSERT INTO `settings` (`id`, `min_dep`, `min_width`, `ref_percent`, `vk_group`, `vk_token`, `payment_type`, `fk_id`, `fk_secret1`, `fk_secret2`, `pt_shopid`, `pt_secret`, `payeer_shopid`, `payeer_secret`, `created_text`, `created_at`, `updated_at`) VALUES
(1, 250, 1500, 5, 'https://vk.com/', '11', 0, 181471, 'u7i7xqnk', 'k2lsk6tc', 'df', 'dsf', '921357081', 'JvgV3F2@cLc7BHm', 'Переходите на Главную страницу сайта. Перед вами список всех доступных игр.У вас на счету 600 долларов. Большую часть времени вы будете тратить на проигрыш игрового баланса, но самым важным моментом будет игра после проигрыша, по схеме которая описана ниже. \r\nЭТАП 1. Заходите в игру ALHEMY (Алхимия), первоначальная ставка в игре 5 долларов, с некоторым увеличением второй и третьей ставки, это нормально, так и должно быть. В самой игре есть 12 ячеек, вы можете делать ставки и открывать любые ячейки. Суть первого этапа - изобразить обычную игру с проигрышем, для этого нам ничего не нужно кроме как просто открывать ячейки и постепенно проигрывать игровой баланс. Нужно, открывая ячейки, уменьшить баланс до 230-240 долларов. \r\n ЭТАП 2. После того как будет достигнут этот результат, из игры Алхимия мы выходим и переходим в игру TREASURE (КЛАД). ПЕРЕХОДИМ В ИГРУ И НАЧИНАЕМ ИГРАТЬ МГНОВЕННО, ЭТО ОЧЕНЬ ВАЖНО! В этой игре самая дорогая ставка которая есть на сайте и в игре Клад нужно все сделать максимально быстро и четко, по сути только здесь мы и зарабатываем. Итак - вошли в игру Клад, ставка 100 долларов. СТАВИМ ПО ОЧЕРЕДИ В ПОСЛЕДНЮЮ ЯЧЕЙКУ ПЕРВОГО, ВТОРОГО И ТРЕТЬЕГО РЯДА! ЕСЛИ ВЫ РАБОТАЕТЕ С ТЕЛЕФОНА - РЯДОВ БУДЕТ ЧЕТЫРЕ. ТО ЕСТЬ СТАВКА ПРОИСХОДИТ ПО ЛИНИИ ПЕРПЕНДИКУЛЯРНО ВНИЗ. ПОСЛЕ ТОГО КАК СДЕЛАНЫ СТАВКИ В ПОСЛЕДНЮЮ ЯЧЕЙКУ ВСЕХ ЛИНИЙ, ВОЗВРАЩАЕМСЯ СНОВА В ПЕРВУЮ СТРОКУ И ПРОДОЛЖАЕМ ДЕЛАТЬ ТОЖЕ САМОЕ. ДЕЛАЕМ СТАВКИ В ТАКОМ ФОРМАТЕ ДО ДОСТИЖЕНИЯ СУММЫ 1700-1900 ДОЛЛАРОВ И ОСТАНАВЛИВАЕМСЯ! \r\nЭТАП 3. Возвращаемся в игру ALHEMY (Алхимия). Снова делаем рандомные ставки на любые ячейки по 5 долларов, цель - проиграть 500 долларов.\r\nЭТАП 4. Снова идем в игру TREASURE (КЛАД). СТАВИМ ПО ОЧЕРЕДИ В ПОСЛЕДНИЕ ЯЧЕЙКИ ВСЕХ ИГРОВЫХ РЯДОВ. ТО ЕСТЬ СТАВКА ПРОИСХОДИТ ПО ЛИНИИ ПЕРПЕНДИКУЛЯРНО ВНИЗ. ПОСЛЕ ТОГО КАК СДЕЛАНЫ СТАВКИ ВО ВСЕ ПОСЛЕДНИЕ ЯЧЕЙКИ ВСЕХ ТРЕХ СТРОК, ВОЗВРАЩАЕМСЯ СНОВА В ПЕРВУЮ СТРОКУ И ПРОДОЛЖАЕМ ДЕЛАТЬ ТОЖЕ САМОЕ. ДЕЛАЕМ СТАВКИ В ТАКОМ ФОРМАТЕ ДО ДОСТИЖЕНИЯ СУММЫ 3000-3300 ДОЛЛАРОВ И ОСТАНАВЛИВАЕМСЯ! Если вы достигли нужной, значит все было сделано правильно, мои поздравления. Как видите, ничего сложного если строго выполнять все инструкции. Первый день закончен.отпишитесь мне по результатам игры и конечной выигрышной сумме которая сейчас есть на балансе. УДАЧНОЙ ИГРЫ', NULL, '2020-05-06 22:29:15'),
